import React from "react";
import "./App.css";

const App = () => {
  const testArr = ["감자", "고구마", "오이", "가지", "옥수수"];
  return (
    <div>
      {testArr
        .filter(function (item) {
          return item !== "오이";
        })
        .map(function (item) {
          return <div className="square-Style">{item}</div>;
        })}
    </div>
  );
};

export default App;

